import { useLocation } from 'react-router-dom'

const ShowPage = () => {
    const location = useLocation()
    const { resume } = location.state
    const { createdAt, level, title } = resume
    console.log(resume)

    return (
        <>
            <h1>Show Page</h1>
            <h1>{title}</h1>
            <h3>{level}</h3>
            <h3>{createdAt}</h3>
        </> 
      );  
}

export default ShowPage;

